import React from 'react'
import './App.css';
import {SearchBar} from '../SearchBar/SearchBar'; 
import {SearchResults} from '../SearchResults/SearchResults';
import {Playlist} from '../Playlist/Playlist';

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      searchResults: [
        { 
          name: 'Suzanna',
          artist: 'Cohen',
          album: '2 years in Paris',
          id: 1
        }, 
        {
          name: 'Suzanna',
          artist: 'Cohen',
          album: '2 years in Paris',
          id: 2
        },
        {
          name: 'Suzanna',
          artist: 'Cohen',
          album: '2 years in Paris',
          id: 3
        }
      ]
    }
  }
  render() {
    
  }
}

export default App;
